   Num = 1,
   NeedLevel = 4,
   NeedFightPower = 7,
}
local L_NamesByString = {
   Name = 2,
   LittleName = 3,
   NormalReward = 5,
   ChapterReward = 6,
}
local L_ColNameIndexs = {
   Num = 0,
   Name = 1,
